    page?:string,
    section?: string,
    changeSection(event : React.MouseEvent<HTMLButtonElement>) : void
}

interface State{
}

class MainWindow extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state = {

        }
    }

    private main() {
        return(
            <div className='mainWindow'>
                <Title page={this.props.page}/>
                <Content section={this.props.section} page={this.props.page} changeSection={this.props.changeSection}/>
            </div>
        )
    }

    render() {
        return this.main();
    }
}

